==简介==
该模板可以产生一个与{{tl|Flagicon}}一模一样格式的旗帜图标。该模板可以用在{{tl|Flagicon}}没有收录的旗帜作图标的场合。
==用法==
<nowiki>{{flagicon image|图片名称|size=可选（默认23x15px）|border=可选}}</nowiki>
==例子==
*<nowiki> {{flagicon image|Flag of Edward England.svg}}</nowiki>→ {{flagicon image|Flag of Edward England.svg}}
*<nowiki> {{flagicon image|Flag of Vojvodina.svg|size=30x15px}}</nowiki>→ {{flagicon image|Flag of Vojvodina.svg|size=30x15px}}
*<nowiki> {{flagicon image|Naval Ensign of Sweden.svg|border=}}</nowiki>→ {{flagicon image|Naval Ensign of Sweden.svg|border=}}
